import { Link } from "react-router-dom";

export default function Header() {
    return (
        <header header>
            <nav style={{ display: "flex", gap: 15 }}>
                <Link to="/">All Trading Pairs</Link>
                <Link to="/prices">Historical Prices</Link>
            </nav>

        </header>
    )
}
